import React from "react";
import vidbg from '../Assets/boat.mp4'
import NavBar from '../Components/Navbar/navbar'


const Main = () => {
    return (
        <div className="main">
            <div className="overlay"></div>
            <video src={vidbg} autoPlay loop muted />
            <div className="content">
                <div className="Navside"><NavBar /></div>
                <div className="title">
                    <h1> Amandx India Pvt Ltd</h1>
                    <p>Connecting Commerce, Globally</p>
                </div>
                
            </div>
        </div>
    );
}

export default Main;
